@Override
public boolean equals(Object o) {
  if (!(o instanceof GeoWideRectangle))
    return false;
  GeoWideRectangle other = (GeoWideRectangle) o;
  return super.equals(other) && other.ULHC.equals(ULHC) && other.LRHC.equals(LRHC);
}

